import React from 'react';

function GuestList({ guests }) {
  return (
    <div className="Guest-iist">
      <h2>Guest List</h2>
      <ul>
        {guests.map((guest, index) => (
          <li key={index}>{guest.guestName} - {guest.guestEmail}</li>
        ))}
      </ul>
    </div>
  );
}

export default GuestList;
